import React from "react";

export default function Navbar() {
  return (
    <>
      <nav className="navbar" id="navbar">
        <ul className="navbar-items-container">
          <li>Works</li>
          <li>About</li>
          <li>Resume</li>
          <li>Contact</li>
        </ul>
      </nav>
    </>
  );
}
